"title": "Fortunato - Pine, Smoke and Whiskey Solid Scent",
"description": "Fortunato :: Pine, Smoke + Whiskey\r\n\r\nA scent worthy of all great adventurers, Fortunato combines crisp pine with warm notes of whiskey and amber, the deep musk of frank and myrrh, and a hint of campfire smoke. Fortunato truly embodies the gypsy spirit.\r\n\r\nFortunato&#39;s tale is an epic one indeed! We&#39;ll give you the super-condensed version here: Imagine, please, a handsome gypsy fellow from the deep South, with bright blue eyes and dark disheveled hair, washing his filthy face and arms in a horse trough. Imagine further the Madame&#39;s surprise when this forsaken character rushed toward her, dripping horse water, exclaiming incoherently and causing her to drop all of the herbs she had painstakingly spent all morning collecting. It was no wonder she cracked him over the head with one of his own bottles of snake oil.\r\n\r\nWhen Fortunato came to, he found himself significantly sobered and surrounded by various members of the troupe: the Horned Devil Man, the Fiji Mermaid, Morgan the Cloven Lady, who all listened intently to his tale. Fortunato had been employed as a carpenter in the South, more specifically a coffin-maker. He and his partner Santiago had both fallen for the infamously beautiful voodoo queen Marie Laveau, although sadly Fortunato&#39;s love was unrequited. Upon discovering his partner in throes of passion with the lovely queen, Fortunato lost control. (And most of his memory, from the incident.) Soon after, Santiago mysteriously vanished, and Fortunato thought it best that he should disappear too. He left his home to travel the country, peddling elixirs on the side of the road. And so it went, until the day he saw the Madame pocketing herbs.\r\n\r\nAfter hearing his story, Madame still doubted his sanity but agreed to give him work. While unloading the wagons for the next show, he came across a broken accordion. He had heard these instruments in zydeco music back home, and was fascinated by the intricacy of the parts he saw busted before him. The Madame laughed, telling him it was junk. &quot;If you can fix it, you can keep it.&quot; He set to work immediately. Many nights later, he had finally straightened his last piston and taped his last bellow. He took a deep breath, and gave it a squeeze. The sounds that came out of the machine were rich and dull. His fingers glided across the keyboard, every note playing in synch with the last. Never before had he been so thrilled with a project! Madame was quite pleased as well, and this gypsy boy became accompanist for many of the Scodioli performers.\r\n\r\nVery generously sized 1.0 oz. screw-top container.\r\nHand-poured by the Madame herself.\r\nWaterproof label.\r\n. . . . . . .\r\n\r\nFeedback about this scent:\r\n\r\n&quot;I am SO pleased with this perfume. I LOVE certain smoke fragrances that remind me of actual types of wood being burned in a campfire, but others are just soot to me. This has a good smoke scent, beautifully bolstered by the pine, so you really feel like you have the scent of the campfire in the forest, not just a burn-barrel, wrapped around you. The whiskey adds a solid masculine note...this is all-around great !!&quot;",
