"policy_additional": "A Note About Solid Perfumes:\r\nThe Madame&#39;s solids will last you a long time. Store at room temperature and remember that the main ingredient is WAX: if left in your car on a hot summer day, be aware that it will melt, so please use caution when opening the tin. (Fragrance will return to it&#39;s solid state once cooled.)\r\n\r\nHow To Use Solid Perfumes:\r\nSimply rub your finger over the surface of the perfume, and then apply to any area of the body, preferably pulse points (your body heat will strengthen the scent). Solid perfumes are for external use only. DO NOT use as lip balm, or on sensitive areas.\r\n\r\nAllergies:\r\nRead all ingredients carefully before ordering, please - especially if you have known allergies to certain fragrances. Please contact the Madame if you have any questions or concerns. She is generally very quick at replying.\r\n\r\nWholesale:\r\nMost items are available for wholesale, and custom orders are welcome. Don&#39;t be afraid to ask! However, we will not do consignment and we will not ship our products to you without labels. It&#39;s the beard or nothing, baby.\r\nIf you are inquiring about a wholesale order, please provide the following info:\r\n– Your shop name and physical location.\r\n– Website if possible, or any social media links to your business.\r\n– Images of your shop (this is very important, as we want to ensure that we will be a good fit in your space).\r\n– A list of the products you are interested in carrying.\r\n\r\nInternational Orders:\r\nPlease note that packages can be delayed in customs for a number of reasons, and on rare occasion you may have to pay an additional fee to claim your package. We apologize that we have no control over this situation. Also please know your country&#39;s guidelines and restrictions for international packages. The most typical reason for packages held in customs is that an item contained within is prohibited by that country.\r\n\r\nFeedback:\r\nWe are perfectionists and we are pleasers. We receive very little negative feedback, and of course we&#39;d like to keep it that way! We understand that you may not like the scent you ordered – everyone&#39;s nose experiences scents differently. Before leaving any harsh feedback, please do consider other aspects of your experience here. We are quite proud of our customer service and speedy shipping. We work hard to deliver a positive experience with every order. xo",
"policy_seller_info": null,
"policy_updated_tsz": 1397678985,
"vacation_autoreply": ".  .  .  .  .  .  .  .  .  .  .\r\n\r\nThank you so much for dropping in! Our shop will be closed September 4th-9th, while we do our thing at the Chicago Renegade Craft Fair. Be sure to check back with us after we return - we&#39;ll be adding some exciting new products!\r\n\r\n.  .  .  .  .  .  .  .  .  .  .",
