"policy_additional": "Owing to the sudden growth of our international business (thank you Etsy!), the brother in our team has opened a very, very little work shop in Hong Kong. This effort not only moves us closer to some of our suppliers, but also allows us to ship international orders to Australia, Singapore, Japan, etc. including much of Europe, South America... cheaper and faster. \r\n\r\nNorth American customers, mainly USA and Canada, will not be affected by this addition, for you good folks, it&#39;s business as usual: engraved and shipped from Houston, Texas. Yee Haw!\r\n\r\nThis concept looked good on paper, let&#39;s hope it pays off- wish us luck!\r\n\r\nLastly, for items with multiple colors, for example journals, since our suppliers cannot keep accurate stock levels, we may substitute your purchase with the same product in a different stocked color. \r\n  ",
