"title": null,
"announcement": "Antique, Vintage and Collectible Items.  I send all fragile items to UPS to be professionally packaged, insured and tracked. I never ask for additional shipping. If I under quote it comes from my profit. If I overcharge by $5 I will reimburse.  Any item valued at or over $1000.00 MUST have delivery signature confirmation per UPS.\r\n\r\n PLEASE keep in mind that I call chips, cracks, hairlines and repairs in my porcelain, but these pieces are ANTIQUE and may have tiny imperfections due to age, handing and even sometime the manufacturing process. PLEASE ask any questions you may have on an item prior to purchase.  I DO consider any reasonable offers on my items. \r\n\r\nI strive for a five star rating. If for any reason you feel you cannot give me a five star review, please contact me first so I can try to correct it. I want happy customers.\r\nThank you for looking at my shop, and happy hunting! Patty\r\n\r\nATTENTION :  It has been brought to my attention there are new regulations and restrictions on purchases to European countries. Unfortunately, due to these new procedures, I will no longer be selling outside the continental United States.  ",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for your purchase. I will mail your item  1-3 days after I receive confirmation of payment. All porcelain, glassware etc. will be insured and has already been included in your shipping cost. I will try my best to make sure your item makes it to you safely. I am using UPS to professionally wrap any fragile and or heavy items.  Please let me know when you receive your item and if you are satisfied. I would rather work with you as to receive a bad feedback.  I strive for a 5 star review, if you feel for any reason you cannot give me 5 stars on your order, please contact me first and I will try to correct it. I want happy customers.\r\nPatty",
"digital_sale_message": null,
"last_updated_tsz": 1412516902,
"listing_active_count": 598,
"login_name": "pattyfreeman0612",
"accepts_custom_requests": false,
"policy_welcome": "Welcome and thanks for looking around.  I have been &quot;antiquing&quot; in some form or fashion, (sold on Ebay, sold in antique malls, just collected) for the past 27 years. I don&#39;t know everything for sure. I know a little about a lot (my hubby says I know just enough to be dangerous), haha. Basically, I&#39;ve always just bought what I like and think others would like. Please let me know if you have information on an item that I have incorrectly listed.  I am always learning something new in this business.",
"policy_payment": "Payment is through PayPal at this time. Payment is expected immediately. \r\n\r\nYour identity and shipping address must be verified and eligible for seller protection by PayPal before I will ship. Please double check your PayPal account if you&#39;re not sure about this. Also, I will use the signature required when items are more than $1000, as this is a regulation per UPS. \r\n\r\nI will work with you if there is a high dollar item that you would like to place in a layaway. Just convo me and we can make payment arrangements. Partial payments are non refundable.\r\n\r\nIt has been brought to my attention there are new regulations and restrictions on purchases to European countries. Unfortunately, due to these new procedures, I will no longer be selling outside the continental United States.  ",
"policy_shipping": "I will mail your package through either the postal office or UPS promptly after payment is confirmed. Any item that is fragile or heavy will go through UPS, and will be professionally wrapped, insured and tracked. I have been using UPS on the majority of my items as they are comparable in cost, and have a better turnaround time.\r\n\r\nI ship with Priority mail when I use the USPS. Priority mail is your best option if you need something fast, though you will pay a little more for this method of delivery. These packages usually arrive within 2-3 business days after being accepted by the post office. \r\n\r\n All porcelain, glassware etc. will be insured and has already been included in your shipping cost. I will try my best to make sure your item makes it to you safely.  Please let me know when you receive your item and if you are satisfied. I would rather work with you as to receive a bad feedback. \r\n\r\n\r\nIt has recently come to my attention that items of Cuban origin are not to be sold. As to my knowledge, I do not have any listed. If you feel I have erroneously added such an item, please bring it to my attention and I will immediately research and or remove such item from my shop.\r\n\r\nATTENTION :  It has been brought to my attention there are new regulations and restrictions on purchases to European countries. Unfortunately, due to these new procedures, I will no longer be selling outside the continental United States.  Although stated on my listings that I am selling to the United Kingdom, this is no longer valid.",
"policy_refunds": "I write descriptions as clearly as possible and post pics. Please carefully read the description and look at the photos of things that interest you. If you have any questions, strike up a conversation with me. I&#39;m more than happy to give you as much additional info and pictures as possible. I&#39;d much rather we communicate before a purchase than you be unhappy afterward.\r\n\r\nPLEASE keep in mind that I call chips, cracks, hairlines and repairs in my porcelain, but these pieces are ANTIQUE and may have tiny imperfections due to age, handing and even some time the manufacturing process. PLEASE ask any questions you may have on an item prior to purchase, as I do not refund due to buyers remorse.\r\n\r\nRefunds are issued through the carrier only when an item is damaged in transit. Buyers MUST contact me within 7 days of receipt in order to proceed with the refund process.",
"policy_additional": "Almost all of the items that are listed here are from outside sources such as estate auctions and private homes. For that reason, I cannot guarantee that the items are from smoke-free environments.  I am more than happy to reserve an item up to 7 days. \r\n\r\nI strive to have a five star review, if for any reason you feel you can not give me 5 stars, please contact me so I can make it right. I want only happy customers.\r\n",
