"description": "✮This is a listing for customized printable invitation in DIGITAL FORMAT ✮\r\n✮ No printed material will be shipped ✮\r\n\r\n=========\r\nITEM INFO\r\n=========\r\nYou will receive 3 digital files via email (based on the layout as shown in the listed picture)\r\n✮ 1 JPG file. 5x7 inch. 300 dpi. RGB\r\n✮ 1 PDF file. 5x7 inch. 300 dpi. RGB\r\n✮ 1 PDF file. 5.125 x 7.125 inch with bleed. 300 dpi. RGB\r\n\r\n✮ (upon request) 1 PDF file. 8.5x11 inch with 2 invitations per page. With bleed and crop mark.\r\n\r\nWith the above, you may:\r\n✮ print them at home, photo lab or print shop.\r\n✮ email them to friends and family.\r\n\r\n==================\r\nHOW TO PURCHASE\r\n==================\r\n1) PURCHASE this listing.\r\n\r\n2) PROVIDE the following INFO via &quot;note to seller&quot;\r\n✮ Name of Honoree\r\n✮ Date & Time\r\n✮ Venue Name (if any) & Address\r\n✮ RSVP contact name, phone number and/or email address\r\n\r\n3) You will receive a ready-to-print proof via email (which is a high resolution printable jpg file. 5x7 inch. 300 dpi. RGB). PDF file will follow upon approval of the proof.\r\n\r\n4) You may print the invitations at home or print shop or simply email them to your friends and family.\r\n\r\n=================\r\nTURNAROUND TIME\r\n=================\r\n✮ please refer to the current turn-around time stated in &quot;Shop Announcement&quot; beneath the shop banner. It ranges from 12 hours - 2 business days depending on the current demand.\r\n(*** Right after you place the order, you will receive an automated message with the current turnaround time***)\r\n\r\nIf you are in rush, please choose Rush Order when you check out the item. First proof will be provided within 24 hour.\r\n\r\n=====================\r\nRECOMMENDED PAPER\r\n=====================\r\nRecommend to print them on smooth matt white card stock.\r\nCommon printing paper is 80gsm. Recommend to print the invitations on 160-216gsm matt white card stock.\r\n\r\n=======\r\nCOLOR\r\n=======\r\nColors may be slightly different in different monitors.\r\n\r\n================================\r\nOTHER ADULT BIRTHDAY INVITATIONS\r\n================================\r\nwww.etsy.com/shop/ThePaperWingCreation?section_id=14425114\r\n\r\n=========\r\nMY SHOP\r\n=========\r\nwww.etsy.com/shop/ThePaperWingCreation",
