"title": "***20% OFF BIRTHDAY SALE***",
"announcement": "Blessons Apparel is celebrating it&#39;s FIRST birthday!! 20% OFF entire shop with coupon code BIRTHDAY  *coupon code MUST be used at the time of purchase. No refunds will be given. Valid October 6th-October 10th*\r\nWelcome to Blessons Apparel! \r\n*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*\r\n\r\n\r\n**CHECK OUT MY TANK TOPS OF THE MONTH!** Each month, I will feature four different tank tops for $15.00 each! These tanks will ship to you the exact way they appear in the FIRST listing picture. I am unable to change the color of the tank or text. Each design is also listed in my shop sections to purchase if you wish to make changes to it.**\r\n*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*\r\nI am currently not accepting custom orders, sorry!!\r\n*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*\r\nCurrent Processing Time is 10-15 Business Days. \r\nIf you are needing a tank sooner, please message me PRIOR to buying so I can let you know if I am able to process your order in time. :)\r\n*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*\r\nPlease Check Out My Current Lines Of Tank Tops:\r\nTANK TOP OF THE MONTH\r\nSweaty Little Bride \r\nPretty Little Workout\r\nFunny Little Workout\r\nLittle Miss Workout\r\nLittle Miss Couture\r\nLittle Miss Blessed\r\nLittle Miss Southern\r\nLittle Miss Pride\r\nLittle Miss Inspiration\r\n*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*\r\nFeel free to look around, if you have any questions, just convo me! I will get back to you as soon as possible! I do work a full time job during the day, but try to get back to you ASAP!! XoXo Danielle\r\n*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you so much for your purchase! I am excited to get your order made and shipped to you. I am so grateful for all of the love, support, and feedback I have received. Below are the answers to a few questions i have received via convo. By answering them here, hopefully i am able to clear up any confusion or questions you might have :)  please do not hesitate to reach out to me via convo if you have additional questions! Thank you again! Danielle\r\n\r\nPlease note that I am typically on a 10-12 business day (2 week) turnaround to get your items made and shipped out my door. I ship USPS First Class Mail which is typically 3-5 business days. If you are needing your tank sooner, and we have not exchanged messages before your purchase, please contact me immediately here on Etsy via convo. A rush fee may apply. \r\n\r\nPlease make sure your ETSY address is correct, as I ship directly from Etsy. As soon as I print your shipping label, Etsy will send you the tracking number. You can also track your package under your &quot;purchases&quot; tab. Please allow 24-48 hours to see tracking updates as my local USPS sorting hub is under new management & procedures.\r\n\r\n\r\n\r\n",
"digital_sale_message": null,
"last_updated_tsz": 1412629806,
"listing_active_count": 338,
"login_name": "BlessonsApparel",
"accepts_custom_requests": false,
"policy_welcome": "WeLcOMe to BLeSSoNs APPaReL!\r\n\r\nThE BaSiCs:\r\n\r\n*Current Processing Time is 10-12 Business Days depending on the amount of orders I receive on a daily basis. If you are needing your order sooner, please contact me before purchasing. This will ensure I am able to get your order made and shipped by the date needed. *Additional shipping/processing fees may apply*\r\n\r\n*If you like a certain design but would like it on a different tank and/or a different ink color...No problem. Let me know your selection in the notes to seller section at checkout. If there is an issue with the color choice, I will send you a convo. ONLY WHITE ink is printed on my BLACK tanks. :)\r\n\r\n*SHIPPING is FREE for The United States. All international purchases will have a shipping fee applied*\r\n\r\n*PLEASE, PLEASE, PLEASE check your ADDRESS in ETSY prior to purchasing. I ship your purchase to your Etsy address. Sometimes, Etsy will try to add a &quot;Street&quot;, &quot;Terr&quot; or &quot;Drive&quot; to your address. I DO NOT alter your shipping address. Please understand there may be a shipping delay if you do not include the full address as USPS considers this an &quot;Unconfirmed&quot; shipping address.  If you realize your address is incorrect after purchase, please convo me ASAP to avoid a delay in shipping and/or not receiving your purchase* I am unable to reship/replace ANY purchases that are shipped to an incorrect/undeliverable address* \r\n\r\n*All tanks are handmade and screen printed by me. Additionally, all tanks are made to order, at this time I do not keep an inventory on my shelf of ready made tanks to ship.\r\n\r\n*I am currently not accepting custom orders*\r\n\r\n*ALL Sales are FiNaL* If you have concerns with sizing, please send me a convo. I will try my best to help. I always suggest going up one size when ordering a tank to give you a little wiggle room and length. If you are busty, I definitely recommend going up one size*\r\n\r\n*I am so grateful and get super excited when my tanks are purchased and featured on blogs/instagram by my wonderful customers--it really does make my day!! I am currently unable to send Sponsors/Bloggers/Instagrammers my items for review and/or giveaways. Sorry in advance.*\r\n\r\n*Etsy will send you an email with your tracking number as soon as I print your shipping label. Due to the high volume of orders shipped, please allow 24-48 hours for shipping updates per the tracking number. If your package shows no movement, please contact me and I can work with you to get you your package* \r\n\r\n*I am currently not a wholesaler. However, I never completely rule it out. If you are interested, please contact me*\r\n\r\n*If you have ANY questions, please do not hesitate to send me a convo via Etsy. I am happy to answer and help with questions/concerns you may have :)*\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n",
"policy_payment": "We accept Paypal and all major credit cards/debit cards.",
