"title": "*****Current Lead time is 3 Weeks*****",
"announcement": "*****Current Lead time is 3 weeks*****  Please make sure you have placed your order with plenty of lead time for your item to arrive.\r\n\r\nPersonalized Monogrammed Bridal Gifts.  Bride, Bridesmaid, Groom, Groomsmen, Mother & Father of  the Bride and Groom, Junior Bridesmaid, Flower Girl and Ring Bearer Gifts - Wine Glasses, Champagne Flutes, Tumblers, Beer Mugs, Shot Glasses, Pint Glasses, Mason Jars, Acrylicware and Photo Prop Wood.  ~~~Current production time is 2 weeks~~~\r\n\r\nSPECIAL GIFTS FOR YOUR SPECIAL DAY\r\n\r\nI&#39;m happy to announce that my husband Brent has taken the etched glass and wood projects on.  So if you see and convo&#39;s from him, he&#39;s the man in charge on those areas.\r\n\r\n~~~~~~~~~~~~~~~~~~~~~~\r\nORDERING AND SHIPPING\r\n~~~~~~~~~~~~~~~~~~~~~~\r\n\r\nAll items in my shop are made to order items & not readily available for shipping.  Our production time frame is typically 2 to 3 weeks.  Etched Glassware (by Brent) is a 3 week production time.  Then orders are shipped, usually via USPS mail or UPS.  Each glass is individually padded and boxed to help reduce breakage, then those boxes are shipped together in a larger box .  We try our best to ensure your package arrives safe and sound.  \r\n\r\nWe are always able to do a custom order for any amount of glass you need or any combination of glasses you might want.  No order is too small or too large.  I do give a discount for 20+ glass orders.  Just convo me what you need and I will set you up a custom listing for the discounted price.\r\n\r\nIf I have any questions regarding your order, I will email you to clarify what the order issues are.  If you note any incorrect information in either your convo to me or in the note to seller, please contact me immediately.  Some days we can get orders out more quickly than others depending on order volume.\r\n\r\nNew to etsy?  Here&#39;s a link to help you make your first purchase:\r\nhttp://www.etsy.com/help/article/339/\r\n\r\n\r\n\r\n~~~~~~\r\nCONVO\r\n~~~~~~\r\nFeel free to convo me at any time.  I generally answer within 12-24 hours. I am a WAHM with a 3 year old, so  If you have not heard from me within the 24 hr time frame, please convo me again (sometimes they get lost in space).  I try to spend my weekends with my family so any convos received over the weekend will be answered on Monday.  We are always open to your ideas and will always try to work with you on any special requests that you have. \r\n\r\n~~~~~~~~~\r\nFEEDBACK\r\n~~~~~~~~~\r\nI am a buyer on etsy myself and I know the power of feedback.  Please let us know what type of experience you&#39;ve had with us.  We strive to do our best and sometimes we make errors, but I will always try my best to correct them as quickly as possible.  \r\n\r\n\r\n\r\n\r\nhttp://www.etsy.com/help/article/102/\r\nThanks for taking a look at us and HAPPY SHOPPING!\r\nAlisha\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "We are on a family vacation August 17th-25th.  If you have any issues with an order please feel free to contact me at the email address on your order.  All orders placed with an expected ship date of 8/23 or sooner has shipped.  I will reopen on the 26th.",
"sale_message": "Thank You for your order!\r\n\r\nAll orders are custom made in my shop!  Other than this notification, unless I receive a convo from you before placing your order or unless I see a problem in your NOTE TO SELLER to me that I have a question about, I will not contact you until the order ships.  You will receive a shipping confirmation with the tracking number when your order ships.  \r\n\r\nOur current turn around time is 2 to 3 weeks (does not include weekends or holidays) once payment and personalization information is received.   Etched Glassware is 3 weeks turn around time.   We ship using either USPS with tracking information or UPS depending on which price is better for your particular order.\r\n\r\nIf you have questions concerning your scheduled delivery date, go to your etsy account,  purchases and reviews and view your receipt.  On your receipt, there is a scheduled delivery date which is the schedule we use to produce our work and is the date that your order will ship by.  \r\n\r\nSince all orders are custom made to your specifications and in the order that you tell us to make them in no returns or refunds will be offered unless it is an error on our part.  Please double check your personalization spelling and order of letters you wish for us to put on your product (first, LAST, middle) or (female first, LAST, male first).\r\nOnce again, thank you for shopping with us and we hope you love your purchase.\r\n******************************************************************************************\r\nPlease remind everyone to &#39;Hand Wash Only&#39; for best results. ",
"digital_sale_message": null,
