"title": "24 Whiskey Stones Soapstone Chilling Rocks Beverage Chillers Soapstone Cubes Ice Rocks Soapstone Rocks",
"description": "These Whiskey Stones (Soapstone Cubes/Ice Rocks) are perfect for keeping your favorite drink cold for hours. Whether it&#39;s a everyday afternoon soda or high quality wine, these soapstone ice cubes will keep your drink ice cold. Soapstone Cubes won&#39;t melt like regular ice and water down your drink. Simply place in freezer for 2 hours and you&#39;re good to go. 3 cubes will be more than enough for one drink.\r\n\r\nAll of our products are crafted with state-of-the art CNC technologies to ensure quality product and precision every time.\r\n\r\nALL OF OUR PRODUCTS ARE PROUDLY CRAFTED IN THE UNITED STATES OF AMERICA!\r\n\r\nSoapstone is non-porous so that no products found in the kitchen will penetrate the stone. Soapstone is chemically neutral so acids like lemon or tomato juice do not affect it nor do any cleaners.\r\n\r\nBuy with confidence! Connecticut Soapstone has been in the stone industry for more than 10 years. \r\n\r\nVISIT US ON THE WEB AT www.ctsoapstone.com. \r\n\r\nConnecticut Soapstone is Connecticut&#39;s premier fabricator of custom countertops and all stone products. We specialize in Soapstone, Granite, Corian®, Quartz, Marble, and Wood countertops and so much more! Don’t take a chance. Choose Connecticut Soapstone and enjoy craftsmanship, service, and quality second to none.\r\n\r\nThese Soapstone Cubes are:\r\n-Brand new and hand crafted in the United States of America\r\n-The best way to keep your drinks cold\r\n-Approximately 7/8&quot; x 7/8&quot; x 7/8&quot;\r\n-100% SOAPSTONE\r\n-Soapstone is very soft, so it won&#39;t scratch glass\r\n-They are also odorless and colorless so they won&#39;t effect the flavor of any drink\r\n\r\nTo use, simply wash, place the cube in your freezer for 2 hours, and then place in your drink. Enjoy!\r\n\r\nThis package includes:\r\n-24 Soapstone Cubes\r\n-Instructions and information\r\n\r\nFeel free to contact us at anytime for questions, concerns, and bulk orders.\r\n\r\nEmail: sam@ctsoapstone.com\r\n\r\nConnecticut Soapstone - Showroom & Fabrication\r\n22 Vermont Drive, Willimantic, CT 06226\r\nTel: 860-456-SOAP (7627)\r\nFax: 860-450-0000\r\n\r\nSamTree Granite & Marble - Showroom\r\n699 Storrs Road, Storrs, CT 06268\r\nTel: 860-450-0450, 860-553-6161\r\nFax: 860-553-6162\r\n\r\n\r\n\r\nwww.CTSoapstone.com\r\nwww.USGranitefurniture.com\r\nwww.USBuildingSuppliers.com",
